import TextField from '@mui/material/TextField';

export const IdealSleepingHours = ({ idealSleepingHours, handleChange }) => {

  return (
    <TextField
      autoFocus
      fullWidth
      label="目標睡眠時間"
      margin="dense"
      onChange={handleChange}
      required
      type="number"
      value={idealSleepingHours}
      variant="standard"
    />
  )
}
